import { View, Text } from "react-native";
import React from "react";

export default function RewardCard() {
  return (
    <View
      style={{
        alignItems: "center",
        alignContent: "center",
      }}
    >
      <View
        style={{
          backgroundColor: "green",
          height: 40,
          width: 180,
          marginTop: "6%",
          borderRadius: 20,
        }}
      ></View>
    </View>
  );
}
